export const changeLogs = [
  {
    id: 1,
    title: 'Initial Release',
    date: "Jan 21, 2019",
    logs: [
      {
        description: 'Initial release version 1.3',
      }
    ]

  }, {
    id: 2,
    title: 'V-1.4 ',
    date: "Jan 22, 2019",
    logs: [
      {
        description: 'Added 2 Starter Templates',
      }
    ]
  }, {
    id: 3,
    title: 'V-1.5 ',
    date: "Jan 26, 2019",
    logs: [
      {
        description: 'Updated to CRA-2',
      }
    ]
  }, {
    id: 4,
    title: 'V-1.6 ',
    date: "Mar 30, 2019",
    logs: [
      {
        type: 'add',
        description: 'Added jwt Auth starter-template',
      }, {
        type: 'add',
        description: 'Added Sticky app',
      }
    ]
  }, {
    id: 5,
    title: 'V-1.7 ',
    date: "Apr 2, 2019",
    logs: [
      {
        type: 'add',
        description: 'Added Firebase CRUD with redux-thunk',
      }, {
        type: 'add',
        description: 'Added HTML version',
      }
    ]
  }
];
